import React from "react";

import Box from "@mui/material/Box";
import Breadcrumbs from "@mui/material/Breadcrumbs";
import Link from "@mui/material/Link";
import Stack from "@mui/material/Stack";
import Table from "@mui/material/Table";
import TableBody from "@mui/material/TableBody";
import { tableCellClasses } from "@mui/material/TableCell";
import TableContainer from "@mui/material/TableContainer";
import TableHead from "@mui/material/TableHead";
import TableRow from "@mui/material/TableRow";
import Typography from "@mui/material/Typography";
import { styled, useTheme } from "@mui/material/styles";
import Footer from "../Footer/Footer";
import { StyledTableCell, StyledTableRow } from "../InvoicePage/InvoicePage";
import { useNavigate } from "react-router-dom";

const DetailInvoiceTableCell = styled(StyledTableCell)(({ theme }) => ({
  [`&.${tableCellClasses.body}`]: {
    color: theme.palette.primary.main,
  },
}));

const DetailInvoicePage = () => {
  const theme = useTheme();
  const gray2 = theme.palette.gray2.main;
  const gray3 = theme.palette.gray3.main;
  const navigate = useNavigate();

  const textStyle = {
    fontSize: "1.125rem",
    fontWeight: "500",
  };

  const boldTextStyle = {
    ...textStyle,
    fontWeight: "700",
  };

  return (
    <div>
      <Stack
        spacing="42px"
        sx={{
          width: "1140px",
          margin: "0 auto",
          marginTop: "46px",
          marginBottom: "304px",
        }}
      >
        <Stack spacing="36px">
          <Breadcrumbs separator=">" sx={{ color: gray3, fontWeight: "600" }}>
            <Link
              underline="hover"
              href="#"
              sx={{ color: gray3, fontWeight: "600" }}
            >
              Home
            </Link>
            <Link
              underline="hover"
              href="#"
              sx={{ color: gray3, fontWeight: "600" }}
              onClick={() => navigate('/invoice')}
            >
              Invoice
            </Link>
            <Typography
              paragraph={true}
              color="primary"
              sx={{ margin: "0", fontWeight: "600" }}
            >
              Details Invoice
            </Typography>
          </Breadcrumbs>

          <Stack spacing="30px">
            <Typography
              variant="h6"
              component="h1"
              sx={{ color: gray2, textAlign: "left", fontWeight: "700" }}
            >
              Details Invoice
            </Typography>

            <Stack
              direction="row"
              sx={{ justifyContent: "space-between", color: gray2 }}
            >
              <Box
                sx={{
                  display: "grid",
                  gridTemplateColumns: "130px 265px",
                  gap: "8px 24px",
                  textAlign: "left",
                }}
              >
                <Typography sx={textStyle}>No. Invoice :</Typography>
                <Typography sx={textStyle}>SOU00003</Typography>

                <Typography sx={textStyle}>Date :</Typography>
                <Typography sx={textStyle}>12 June 2022</Typography>
              </Box>

              <Stack direction="row" spacing={3} sx={{ alignSelf: "flex-end" }}>
                <Typography sx={boldTextStyle}>Total Price</Typography>
                <Typography sx={boldTextStyle}>IDR 450.000</Typography>
              </Stack>
            </Stack>
          </Stack>
        </Stack>

        <TableContainer component={Box}>
          <Table>
            <TableHead>
              <TableRow>
                <DetailInvoiceTableCell>No</DetailInvoiceTableCell>
                <DetailInvoiceTableCell>Course Name</DetailInvoiceTableCell>
                <DetailInvoiceTableCell>Type</DetailInvoiceTableCell>
                <DetailInvoiceTableCell>Schedule</DetailInvoiceTableCell>
                <DetailInvoiceTableCell>Price</DetailInvoiceTableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              <StyledTableRow>
                <DetailInvoiceTableCell>1</DetailInvoiceTableCell>
                <DetailInvoiceTableCell>
                  Tom Yum Thailand
                </DetailInvoiceTableCell>
                <DetailInvoiceTableCell>Asian</DetailInvoiceTableCell>
                <DetailInvoiceTableCell>
                  Wednesday, 27 July 2022
                </DetailInvoiceTableCell>
                <DetailInvoiceTableCell>IDR 450.000</DetailInvoiceTableCell>
              </StyledTableRow>
            </TableBody>
          </Table>
        </TableContainer>
      </Stack>

      {/* <Footer /> */}
    </div>
  );
};

export default DetailInvoicePage;
